    Sound water area. Marine species are generally assemblages of discrete populations
    occupying various ecological niches. Genetic changes to  populations can occur as
    a result of genetic drift, introgression between populations, local adaptation,
    etc. This project provides genetic baseline data to monitor genetic change in plants,
    animals, and algae.nnGenetic data.",nt"license_title": null,nt"extras":
